import React, { useEffect } from 'react';

const Navbar = () => {
  useEffect(() => {
    const handleLinkClick = (e) => {
      e.preventDefault();
      const target = $(e.target).attr('href');
      const offset = $(target).offset().top - 120;
      $('body, html').animate({
        scrollTop: offset
      }, 1000);
    };

    $('a').click(handleLinkClick);

    return () => {
      $('a').off('click', handleLinkClick);
    };
  }, []);

  return (
    <header className="header">
      <a className="logo" href=".page-top">PixelStretch</a>
      <input className="menu-btn" type="checkbox" id="menu-btn" />
      <label className="menu-icon" htmlFor="menu-btn"><span className="navicon"></span></label>
      <ul className="menu">
        <li><a href="#one" className="link link-theme link-arrow">HOME</a></li>
        <li><a href="#two" className="link link-theme link-arrow">SERVICE</a></li>
        <li><a href="#three" className="link link-theme link-arrow">ABOUT US</a></li>
        <li><a href="#four" className="link link-theme link-arrow">CONTACT</a></li>
      </ul>
    </header>
  );
};

const IntroSection = () => {
  return (
    <section className="intro">
      <article className="container">
        <h1>
          Front-end <strong>Development</strong>
        </h1>
        <p>
          <a href=".footer" className="link link-theme link-arrow" title="Let’s Build Something Great">LET’S BUILD SOMETHING GREAT</a>
        </p>
      </article>
    </section>
  );
};

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <hr />
        <article className="foot-content-left">
          <ul>&copy;2016 by Pixel Strecher</ul>
        </article>
        <article className="foot-content">
          <ul>
            <li><a href="mailto:pixelstrecher@gmail.com">pixelstrecher@gmail.com</a></li>
            <li className="social"><a href="https://www.facebook.com/">Facebook</a></li>
            <li className="social"><a href="https://twitter.com/">Twitter</a></li>
            <li className="social"><a href="https://www.linkedin.com/company/">LinkedIn</a></li>
          </ul>
        </article>
      </div>
    </footer>
  );
};

const ExampleComponent = () => {
  return (
    <div className="page-top">
      <Navbar />
      <div>
        <div id="main" className="main">
          <IntroSection />
          <section className="work">
            <article className="container" id="one"></article>
          </section>
          <Footer />
        </div>
      </div>
    </div>
  );
};

export default ExampleComponent;
